To create a Layout component with tailwindcss that has two variants, full-width and centered, you can use the following code:
```jsx
import React from 'react';
import cn from 'classnames';

const Layout = ({ children, className }) => {
  const classes = cn(
    'mx-auto', // Center horizontally
    {
      'max-w-full': className === 'full-width', // Full width variant
      'max-w-7xl': className === 'centered', // Centered variant with max-width of 1200px
    },
    className // Additional classes passed via the className prop
  );

  return <div className={classes}>{children}</div>;
};

export default Layout;
```
Explanation:
1. We import the `classnames` library (assuming you have it installed) to conditionally apply classes based on the `className` prop.
2. We define the `Layout` component that accepts `children` and `className` props.
3. Inside the component, we use the `classnames` library to conditionally apply the classes based on the `className` prop:
   - `'mx-auto'` is always applied to center the component horizontally.
   - If `className` is `'full-width'`, we apply `'max-w-full'` to set the maximum width to 100%.
   - If `className` is `'centered'`, we apply `'max-w-7xl'` to set the maximum width to 1200px (equivalent to `max-w-7xl` in tailwindcss).
   - We also include the `className` prop itself to allow additional classes to be passed.
4. Finally, we render a `div` with the computed classes and the `children` prop.

