  const numBytes = view.length;
  const entities = [];

  let offset = 0;
  let currentByte = 0;
  let bitsUsed = 0;

  while (offset < numBytes) {
    if (bitsUsed === 0) {
      currentByte = view[offset++];
    }

    const id = (currentByte >> bitsUsed) & 0xf;
    bitsUsed += 4;

    if (bitsUsed === 8) {
      currentByte = view[offset++];
      bitsUsed = 0;
    }

    const size = (currentByte >> bitsUsed) & 0x7;
    bitsUsed += 3;

    if (bitsUsed === 8) {
      currentByte = view[offset++];
      bitsUsed = 0;
    }

    entities.push({ id, size });
  }

  return entities;
}
